volatile int pixel_buffer_start;

typedef enum {
	title,
    gamestart,
	winner
} gamestate;

gamestate state;

int main(void)
{
    volatile int* pixel_ctrl_ptr = (int*)0xFF203020;

    *turn = 0;
    score_red = 0;
    score_blue = 0;
    is_horizontal = 1;
    x = 20;
    y = 20;
    delX = 0;
    delY = 0;
    color = RED;

    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the
                                        // back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen();
    draw_title();
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer

    disable_A9_interrupts();
    set_A9_IRQ_stack(); 
    config_GIC();
    config_PS2(); 
    enable_A9_interrupts();
        
    draw_title();

    state = title;

    clear_all_text();
    write_string(30, 55, "Press [SPACE] to Begin");

    // instructions
    write_string(10, 26, "I N S T R U C T I O N S");
    write_string(11, 30, "W : Move Up");
    write_string(11, 33, "A : Move Left");
    write_string(11, 36, "S : Move Down");
    write_string(11, 39, "D : Move Right");
    write_string(11, 42, "[SHIFT] : Change Orientation");
    write_string(11, 45, "[ENTER] : Place Line");

    write_string(45, 38, "Player 1: RED    Player 2: BLUE");
    write_string(43, 41, "A player that completes the fourth");
    write_string(45, 43, "side of a box conquers the box.");
    write_string(45, 45, "The player with more boxes WIN!");

    while (1) {   
        switch (state) {
            case title:
                if (game_start) {
                    state = gamestart;
                }
                break;
            case gamestart:
                if (*turn == 0)
                    color = RED;
                else if (*turn == 1)
                    color = BLUE;

                clear_screen();
                clear_all_text();
                plot_grid();
                display_line(is_horizontal, x, y, color);
                print_red_num(score_red);
                print_blue_num(score_blue);
                print_turn(*turn);

                wait_for_vsync();
				pixel_buffer_start = *(pixel_ctrl_ptr + 1);
				break;   
            case winner:
 				clear_screen();
                clear_all_text();
				if (score_blue == 9) {
                    write_string(35, 30, "Winner : BLUE");
                } else if (score_red == 9) {
                    write_string(35, 30, "Winner : RED");
                }
                write_string(30, 52, "Press [SPACE] to Restart");
				draw_end();

                reset_game();

                wait_for_vsync();
				pixel_buffer_start = *(pixel_ctrl_ptr + 1);
				break;                             
        }
    }
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int*)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

short int get_pixel(int x, int y) {
	return *(short int *)(*(int *)0xFF203020 + (y << 10) + (x << 1));
}

void draw_horizontal(int x0, int y, int x1, short int line_color)
{
	int i = 0;
    for (i = x0; i < x1; i++) {
        plot_pixel(i, y, line_color);
    }
}

void draw_vertical(int x, int y0, int y1, short int line_color)
{
	int i = 0;
    for (i = y0; i < y1; i++) {
        plot_pixel(x, i, line_color);
    }
}

void draw_line(short int x0, short int y0, short int x1, short int y1, short int color)
{
    bool is_steep = abs(y1 - y0) > abs(x1 - x0);

    if(is_steep){
        swap(&x0, &y0); 
        swap(&x1, &y1);
    }
    if(x0 > x1){
        swap(&x0, &x1);
        swap(&y0, &y1);
    }

    int deltax = x1 - x0;
    int deltay = abs(y1 - y0); 
    int error = -(deltax / 2);
    int y = y0; 
    
    int y_step;

    if(y0 < y1){
        y_step = 1;
    }else{
        y_step = -1;
    }

    int x;
    for(x = x0; x <= x1; x++){
        
        if(is_steep){
            plot_pixel(y,x, color);
        }
        else{
            plot_pixel(x,y, color);
        }
        
        error = error + deltay;
        if(error >= 0){
            y = y + y_step;
            error = error - deltax;
        }
    }
}

void swap(short int* e1, short int* e2)
{
    int temp = *e1;
    *e1 = *e2;
    *e2 = temp;
}

void wait_for_vsync()
{
    volatile int* pixel_ctrl_ptr = (int*)0xFF203020;
    int status;
    *pixel_ctrl_ptr = 1;
    status = *(pixel_ctrl_ptr + 3);
    while ((status & 0x01) != 0) {
        status = *(pixel_ctrl_ptr + 3);
    }
    return;
}

void clear_screen()
{
    int x, y;

    for (x = 0; x < 320; ++x) {
        for (y = 0; y < 240; ++y) {
            plot_pixel(x, y, BLACK);
        }
    }
}

void update_grid(bool is_horizontal, int x, int y, short int color) {
    int i = (x - 20) / 50;
    int j = (y - 20) / 50;

    if (is_horizontal) {
        grid_horizontal[j][i] = color;
    } else if (!is_horizontal) {
        grid_vertical[j][i] = color;
    }
}

