void draw_title() {
	for (int k = 0; k < 153600; k+=2) {
		int red = ((background[k + 1] & 0xF8) >> 3) << 11; 
		int green = (((background[k] & 0xE0) >> 5)) | ((background[k+1] & 0x7) << 3) ;	
		int blue = (background[k] & 0x1F);	

		short int p = red | ( (green << 5) | blue);
		plot_pixel((k/2)%320, (k/2)/320, p);
	}
}

void draw_end() {
	for (int k = 0; k < 153600; k+=2) {
		int red = ((end_background[k + 1] & 0xF8) >> 3) << 11; 
		int green = (((end_background[k] & 0xE0) >> 5)) | ((end_background[k+1] & 0x7) << 3) ;	
		int blue = (end_background[k] & 0x1F);	

		short int p = red | ( (green << 5) | blue);
		plot_pixel((k/2)%320, (k/2)/320, p);
	}
}	

void write_string(int x, int y, char str[]) {
	int i = 0;
	for (i = 0; i < strlen(str); i++) {
		write_char(x + i, y, str[i]);
	}
}

void write_char(int x, int y, char character) {
	volatile int charBuffer = 0xC9000000;
	*(char *)(charBuffer + (y << 7) + x) = character;
}

void clear_all_text() {
	int x,y;
	for (x = 0; x < 80; x++) {
		for (y = 0; y < 60; y++) {
			write_char(x, y, ' ');
		}
	}
}

