void display_line(bool is_horizontal, int x, int y, short int color) {
    if (is_horizontal){
		int i = 0;
        for (i = x; i < x + 46; i = i + 8){
            draw_horizontal(i, y, i + 3, color);
        }
    }
    else if (!is_horizontal){
		int i =0;
        for (i = y; i < y + 46; i = i + 8){
            draw_vertical(x, i, i + 3, color);
        }
    }
}

void move_line(char dir) {
    switch (dir) {
        case 'w':
            if (!is_horizontal) {
		if (y == 20 && x == 220){
			delX = 0;
			delY = 0;
		}
		else if (y==20){
			delX = 50;
			delY = 0;
		}
                else if (y > 20) {
                    delX = 0;
                    delY = -50;
                }
            } else if (is_horizontal) {
		if (y == 20 && x == 170){
			delX = 0;
			delY = 0;
		}
		else if (y==20){
			delX = 50;
			delY = 0;
		}
                else if (y > 20) {
                    delX = 0;
                    delY = -50;
                }
            }
            x += delX;
            y += delY;        
            
            display_line(is_horizontal, x, y, color);
            break;

        case 'a':
            if (!is_horizontal) {
		if (x == 20 && y == 170){
			delX = 0;
			delY = 0;
		}
		else if (x == 20){
			delX = 0;
			delY = 50;
		}
                else if (x > 20) {
                    delX = -50;
                    delY = 0;
                }
            } else if (is_horizontal) {
		if (x == 20 && y == 220){
			delX = 0;
			delY = 0;
		}
		else if (x == 20){
			delX = 0;
			delY = 50;
		}
                else if (x > 20) {
                    delX = -50;
                    delY = 0;
                }
            }
            x += delX;
            y += delY;        
            
            display_line(is_horizontal, x, y, color);
            break;

        case 's':
            if (!is_horizontal) {
		if (y == 170 && x == 220){
			delX = 0;
			delY = 0;
		}
		else if (y == 170){
			delX = 50;
			delY = 0;
		}
                else if (y < 170) {
                    delX = 0;
                    delY = 50;
                }
            } else if (is_horizontal) {
		if (y == 220 && x == 170){
			delX = 0;
			delY = 0;
		}
		else if (y == 220){
			delX = 50;
			delY = 0;
		}
                else if (y < 220) {
                    delX = 0;
                    delY = 50;
                }
            }
            x += delX;
            y += delY;        
            
            display_line(is_horizontal, x, y, color);
            break;

        case 'd':
            if (!is_horizontal) {
		if (x == 220 && y == 170){
			delX = 0;
			delY = 0;
		}
		else if (x == 220){
			delX = 0;
			delY = 50;
		}
                else if (x < 220) {
                    delX = 50;
                    delY = 0;
                }
            } else if (is_horizontal) {
		if (x == 170 && y == 220){
			delX = 0;
			delY = 0;
		}
		else if (x == 170){
			delX = 0;
			delY = 50;
		}
                else if (x < 170) {
                    delX = 50;
                    delY = 0;
                }
            }
            x += delX;
            y += delY;        
            
            display_line(is_horizontal, x, y, color);
            break;

        default:
            break;
    }
}

